$(document).ready(function(){$.ajax({type:"GET",url:"ajax",data:{ajaxid:"getClusterProficiency"}}).done(function(a){if(a.err)$("#cluster-proficiency-card").css("display","none");else{var i=a.clusterProficiency,e=$("#cluster-proficiency-chart"),n={labels:["Marketing","Finance","Business Administration","Hospitality & Tourism"],datasets:[{data:[i.marketing,i.finance,i.businessadmin,i.hospitality],backgroundColor:["#222D32","#255C99","#EE4266","#3C8DBC"],hoverBackgroundColor:["#222D32","#255C99","#EE4266","#3C8DBC"]}]};new Chart(e,{type:"doughnut",data:n,animation:{animateScale:!0}})}})});